    return (
        <div className="MovieBox">
            {/* <img src={`https://image.tmdb.org/t/p/w400/${list && list.poster_path }`} alt={`${list && list.title } Poster`} /> */}
           <img src={Img_api + poster_path + list} alt={title} />
           <div className="Movie_info">
            <h4>{title}</h4>
            </div>

            

        </div>


    )
}

export default MovieBox
